INSERT INTO `tb_test2` VALUES ('根据2019年4月学校官网信息显示，河海大学是国家首批授权授予学士、硕士和博士学位的高校之一。学校2个学科入围一流学科建设名单。5个学科进入ESI世界排名前1%；有1个一级学科国家重点学科，7个二级学科国家重点学科，2个二级学科国家重点学科培育点，15个一级学科省级重点学科；15个博士后科研流动站，共有43个学位授权点，其中16个一级学科博士学位授权点、38个一级学科硕士学位授权点（含一级博士点）、5个二级学科硕士学位授权点、12个硕士专业学位类别授权点，其中工程硕士包括19个工程领域。', '2017-1WS0908.2-178', 160, '王飞', 5, '2019-04-26 16:17:13', 0, 3);
